import React from 'react';
import './Login.css';
import App from '../../App';
import ReactDOM from "react-dom";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useParams
} from "react-router-dom";

export default function Login() {
  return(
      <Router>
        <Switch>
                        <div className="login-wrapper">
                <h1>Please Log In</h1>
                <form>
                    <label>
                    <p>Username</p>
                    <input type="text" />
                    </label>
                    <label>
                    <p>Password</p>
                    <input type="password" />
                    </label>
                    <div>
                    <button type="submit" Route path="/Home">Submit</button>
                    </div>
                </form>
                        </div>
        </Switch>
      </Router>


  )
}
